import React from "react";
import "./Footer.css";

function Footer() {
  return (
    <div className="footer">
      <div className="footer-box1"></div>
      <div className="footer-box2"></div>
      <div className="footer-box3"></div>
      <div className="footer-box4"></div>
    </div>
  );
}

export default Footer;
